import React from 'react';
import { Link, NavLink } from 'react-router-dom';
import { NavList } from './styles';

export const Menu = () => {

    return(
        <NavList>
             <NavLink to="/"><li>Dashboard</li></NavLink> <br />
             <NavLink to="/listar"><li>Listar</li></NavLink> <br />
        </NavList>
    )

}
